import React from "../../../node_modules/react"
//import local file 
import './Aboutme.css'
import Welcome from '../../components/welcome/Welcome.js'
import Scrolldown from '../../components/Scrolldown.js'
import Skills from '../Aboutme/Skills.js'
import { makeStyles } from '@material-ui/core/styles';
import Timeline from '../../components/Timeline_page2.js'
const ColoredLine = ({ color }) => (
  <hr
      style={{
          color: color,
          backgroundColor: color,
          height: 3,
          width: '80%'
      }}
  />
);


const useStyles = makeStyles(theme => ({
  PageSkills: {
    width: '80%',
    height: '900px',
    marginLeft: 'auto',
    marginRight: 'auto',
    [theme.breakpoints.down('sm')]: {
      height: '1700px',
      width: '95%',

    },
  },
  PageAboutme: {
    width: '80%',
    height: '300px',
    marginLeft: 'auto',
    marginRight: 'auto',
    [theme.breakpoints.down('sm')]: {
      height: '400px',
      width: '95%',

    },
  },
}))



function Aboutme(props) {
  const classes = useStyles();



  return (
    <div >
      <Welcome/>
      <div>next</div>
      <Scrolldown></Scrolldown>
      <ColoredLine color='black' />
      <div className={classes.PageAboutme}>
        <h1 className="TitleAboutMe">About me</h1>
        <p className="TextAboutMe">Milan based | 2011. Toronto | 2018. Vancouver | 2018. London</p>
        <p className="TextAboutMe">I'm a lifelong traveler who lived in Milan, Vancouver, Toronto, and London, always looking for new challenges.
Technology and computers have been in my life since I was a kid.</p>
<p className="TextAboutMe">I started to code and design stuff at a very young age.
I have always loved everything related to arts, solution design, creative thinking, and pixels.</p>
      <p className="TextAboutMe">I have a passion for music and photography, mountains and skiing.</p>
      <p className="TextAboutMe"><i>"Talk is cheap. Show me the code."</i> - Linus Torvalds</p>
      </div>
      {/* <Timeline /> */}
      <div Bounce_div>next</div>
      <Scrolldown></Scrolldown>      
      <ColoredLine color='black' />
      <div className={classes.PageSkills}>
        <h1 className="TitleAboutMe">IT.SKills</h1>
        <Skills></Skills>
      </div>
    </div>
  )
}

export default Aboutme;
